import { useEffect, useState, useRef } from "react";
import Console from "./console.js";
import Controls from "./controls.js";
import Game from "./game.js";
import PGame from './pgame.js';
import Panel from "./panel.js";
import './styles.css';

/*


	useEffect(() => {
		roleRef.current = role;
		if (role === 'host')
			setTimeout(() => {
				socket.send(JSON.stringify({
					update_type : 'game update',
					obj : JSON.stringify({ name: 'some_name', type: 'multiplayer' }),
					target : 'guest',
				}));
			}, 2000)
		else if (role === 'guest')
			setTimeout(() => {
				socket.send(JSON.stringify({
					update_type : 'player position',
					obj : JSON.stringify({ x: 10, y: 30 }),
					target : 'host',
				}))
			}, 4000)
	}, [role])


