		<div>
			<h1>role: {role}</h1>
			<h3>room_name: {room_name}</h3>
			<h2>message: {message}</h2>
			<p>obj: { obj ? obj : [] }</p>
		</div>
	);*/

function App() {
	const [socket, setSocket] = useState(null);
	const [role, setRole] = useState(null);
	const [obj, setObj] = useState(null);
	const [room_name, setRoom_name] = useState(null);
	const [message, setMessage] = useState(null);
	const [p1_score, setP1_score] = useState(0);
	const [p2_score, setP2_score] = useState(0);
	const [players, setPlayers] = useState(0);
	const [state, setState] = useState(-1);
	const [log, setLog] = useState([]);
	const roleRef = useRef(null);

	var	toggle_panel = panel => {
		panel = panel ? false : true;
		document.getElementById(panel ? "panel" : "canvas").classList.replace("off", "on");
 		document.getElementById(panel ? "canvas" : "panel").classList.replace("on", "off");
 		document.getElementById("control").classList.replace(panel ? "on" : "off", panel ? "off" : "on");
 		setTimeout(() => {
 			document.getElementById("finish_configs").classList.replace(panel ? "off" : "on", panel ? "on" : "off");
 		}, 2000);
	}

	useEffect(() => {
		const ws = new WebSocket('ws://localhost:8000/ws/game/');
		ws.onmessage = e => {
			var data = JSON.parse(e.data);
			console.log("current role: ", roleRef.current);
			if (!role && data.role)
				setRole(data.role);
			if (data.message && (data.room_name || data.target === roleRef.current))
				setMessage(data.message);
			if (data.obj && data.target === roleRef.current)
				setObj(data.obj);
			if (data.room_name)
				setRoom_name(data.room_name);
		}
		ws.onerror = e => {
			ws.close();
			setMessage("error on socket");
		}
		ws.onclose = e => {setMessage("socket closed")}
		setSocket(ws);
		return () => {
			if (ws.OPEN)
				ws.close();
			setMessage("socket is done");
		}
	}, [])

	var	send_update = (up_type, obj, target) => {
		socket.send(JSON.stringify({
			update_type: up_type,
			obj: obj,
			target: target,
		}))
	}

	return (
		<div className="App">
			<div id="wrapper">
				<h1>role: {role}</h1>
				<div id="scores">
					<h1>{p1_score}</h1>
					<h1>{p2_score}</h1>
				</div>
				<Panel
					toggle={() => {
						setP1_score(0);
						setP2_score(0);
						toggle_panel(true);
					}}
					state={state}
					setState={setState}
					players={players}
					setPlayers={setPlayers}
					message={message}
					room_name={room_name}
				/>
				{
					role === 'host' ?
					<Game
						state={state}
						setState={setState}
						players={players}
						setPlayers={setPlayers}
						p_1={setP1_score}
						p_2={setP2_score}
						log={log}
						setLogs={setLog}
						send_update={(a, b, c) => send_update(a, b, c)}
						toggle={() => toggle_panel(false)}
					/>
					: role === 'guest' ?
					<PGame
						state={state}
						setState={setState}
						players={players}
						setPlayers={setPlayers}
						send_update={(a, b, c) => send_update(a, b, c)}
						toggle={() => toggle_panel(false)}
						game_update={obj}
					/>
					: []
				}
				<Controls
					state={state}
					setState={setState}
					players={players}
					setPlayers={setPlayers}
				/>
			</div>
		<Console log={log} />
	</div>
	)
}

export default App;
